import Unity, { UnityContext } from "react-unity-webgl";

const unityContext = new UnityContext({

    loaderUrl: 'Build/SampleWebGLBuild.loader.js',
    dataUrl: 'Build/SampleWebGLBuild.data.gz',
    frameworkUrl: 'Build/SampleWebGLBuild.framework.js.gz',
    codeUrl: 'Build/SampleWebGLBuild.wasm.gz',
});

function App() {
    return (
        <div>

            <Unity style={{
                width: "80%",
                justifySelf: "center",
                alignSelf: "center",
            }}
                unityContext={unityContext} />

        </div>
    );
}
